import "./Frame2855.css";

function Frame2855(props) {
  const { children, className } = props;

  return (
    <div className={`frame-28552 ${className || ""}`}>
      <div className="text-55 valign-text-middle ibmplexsans-normal-ebb-14px">{children}</div>
      <div className="rectangle-8596"></div>
      <div className="rectangle-8604"></div>
    </div>
  );
}

export default Frame2855;
